values:
now i understant.... everything was a lie.&nbsp;&nbsp;




and i am left all alone again.&nbsp;


i should just turn over and drown.

i hate all of this... i hate being so scared to talk to you about anything. i dont know what will happen.. what will be said.. and what we will do. It is scary. and i dont like it.&nbsp;


I am trying.. i really am.&nbsp;

but i guess it is just not hard enough for you...&nbsp;



sorry you ever fell for me in the first&nbsp; place.. you can hate me now.

A Weekend with out him makes me go insane.&nbsp;&nbsp;

Pretty much I have been bored out of my mind. So i have been working my fingers to the bones.



dull weekend.

Dont you just love listening to songs with lyrics that have something to do with the way you feel at the time? Because i know i do. It is sooo silly.&nbsp; 

I am crazy.&nbsp;&nbsp; 

Uhh soo...&nbsp; 

I am going to see Panic! At the Disco again in November. (I am really going for Bloc Party.. i like them a lot)&nbsp; 


gah.. i dont know what to do. I am bored.&nbsp; 

I got kind of drunk last night and tried to sleep with chris.. But i was wide awake. and he was.. well trying to sleep. He did stay up with me for a bit and we talked. I liked it.&nbsp; I like him.&nbsp;&nbsp; then i feel asleep. 

Kyle White was sooo wasted last night. It was hilarious. poor guy.&nbsp;&nbsp;

Ok... so&nbsp; my birthday was pretty much AWESOME.&nbsp;

After school i got to hang out with Chris, Mallie, Baylee, Ben, Jordan, and Kyle. Baylee and Jordan made and bought me wonderful food. Brownies and Cookies.&nbsp; Oh goodness the BEST! Mallie put a movie in the DVD player for my birthday... (pretty much awesome... because that movie is amazing)&nbsp;

Yeah.. and then a whole lot of people came over to the APT...&nbsp; Shannon, Julie, Roy, SHELLY!!!!!, Joe, some chic i didnt know... and i am not to sure who else came by.. but it was cool.&nbsp;
Chris was a real sweet heart for the night.&nbsp;

Ended up falling asleep on Julies Floor though.. that was a fun time!


Yeeah.. Thanks to those who made me the happiest 18 year old ever!


now i can legally by porn, Cigs, and lottery Tickets.&nbsp;


I am loving life right about now.

I am slipping from my&nbsp;reality really fast. and i dont know if i could do anything worth while.&nbsp;
I dont even know if i can believe anymore. I am trying to wish this all away, but everytime i look up to the sky, the stars are always covered up by clouds.&nbsp;&nbsp;&nbsp;&nbsp;
It hurts to be honest to the one you love.&nbsp;&nbsp;
I want to believe so hard, but this wish isnt happening. My fairy tale end is destroyed and i dont think i can even see the ending of this nightmare. All i want to do is run or jump into someone's good dream and live there. I cannot take this lie inside, i cannot take this feeling that i did something wrong and i cant fix it anymore. Finally, something i cannot change... i have no control and that is the reason why i feel so.... wrong.
You were my angel behind that mask of perversness. You were my light even though all i wanted to see was dark. You were my happiness when i felt like i was going to die.&nbsp;
I dont understand this feeling.&nbsp; I want to love you like you do me, but something in me is warning me and telling me i shouldnt. i am not ready to love someone yet because i still love a man who flew away from me.&nbsp; It just takes time they say, but this feeling will always be the same.&nbsp; I will never love you the way i love him. And it hurts to say this at all. It just hurts.&nbsp;

i regret ever falling away from you.&nbsp;


Basically the only thought going through my mind right this second.&nbsp;


enjoy my&nbsp; thought.

I dont know what to do. I am stuck in this battle of feelings.&nbsp; I dont know what i want. All i know is that i dont want to get serious with anyone.. well at least not yet. 
I dont want to experience love, because all i learned from it is that sometimes it is a dead feeling.&nbsp; 
I cant control who i want to be with. I really really like someone, but then .. there is someone else who i really like. the thing is.. i think that i like someone more than the other. And i dont know. I just dont want anyone to get hurt. And i know the place i am in right now, someone is going&nbsp; to. AND I DONT WANT IT TO HAPPEN. i just dont know how to stop it from happening.&nbsp;&nbsp;&nbsp; 

I feel gross....&nbsp; 


So once, a long while ago, i thought i loved someone. And when i told them, it seemed to make them distant from me. And it hurt me more than anything.&nbsp; To know that i just poured my emotions out on a plate, and then turned down like some over cooked food. I am not sure what is real anymore and what is pretend. I dont want to do this anymore.&nbsp; 


Once in a short while ago, I reunited with a boy. He is amazing and always has been. I thought we hit it off right then and there. (at the movies when i was kind of on date with someone else.)&nbsp; But yeah, we started to hang out like crazzy, nothing to serious or anything. then, the climax. He told me that he really liked me, i told him i that i really liked him. and that night we fell asleep in each others arms.&nbsp; that next day was a whole mess..&nbsp; turns out, his ex wanted to hang out, they were at the same party i was at.. he failed to even say hi to me. THAT hurt me the most... (you know the whole night i felt so used and worthless.)&nbsp;

But later, he told me how sorry he was and how messed up his ex was. (not to mention how crazy.) And i forgave him.. and lately he has been letting me know in small amounts how much he truely likes me. And t, oh i dont know.. it is just cute. I like him.&nbsp;

so yeah... basically, i dont want to be in a relationship right now. As you can tel... i have some trust issues, and i guess i just dont feel to comfortable with myself to actually make a small commitment of any sort. Right now the only pressing matter at hand are:
The Phantom Toll Booth
Auditions for Tewlfth Night
Log
Showcase
and.. My awesome 18th b-day party my awesome friends are throwing for me.&nbsp;


and i like what i have right now.. with everyone.
Friendships are the most important thing a girl can ever ask for.

I dont know if i like the person i have become. The thought process is a little wacked up.&nbsp;
I like the idea of me now. But i dont want to see what is going to come next?&nbsp;


Not drugs. I refuse.&nbsp;&nbsp;&nbsp;

I guess it is so hard to compete with myself. That is all i seem to be doing to myself. Trying to make myself thinner, taller, prettier, and just.. better. You know... so someone would take a keen notice to me. I do this to myself, but i lie about it to myself. I tell myself, "I love being single." but in real life.. i am dying to be with someone. I know this is silly.

I have reece.

WRONG.&nbsp;He is just my friend. i love him to death, but i am not inlove with him. at least not anymore.

I have Chris.

RIGHT.. but wrong. HE is there,&nbsp; but he cannot be there for me all the time. I mean, he has graduated high school. He has a job. and he doesnt have a car currently. It sucks. It would be ok, if my car was fixed and my family wasnt crazy. I like him a lot.&nbsp;

I have Ben.

RIGHT, but i guess it is just so hard to go back to him. I like that kid to death. but i guess my Wall of Anit-hurt is forming up. I guess i am too afriad that i might get hurt again.&nbsp;&nbsp;

See i am torn. I dont know what to do anymore. Sure i can not think about it. BUT NOT THINKING about it is driving me crazy.&nbsp;

i just want to be held. right now.&nbsp;

I want to be with.....

him.

Gah! I went to White Rock today. AMAZING. Lets see... I went with Ben Morrow, Josh Morrow, Balyee Pruitt, Kyle White, Natasha (his gf) and Jordan Maus!.&nbsp; I jumped off a 45ft cliff into water. The best thing to end my summer.&nbsp;
Yeah hahaha.&nbsp;

Wow, talk about the past. I dont even know.. i have been thinking a lot about all the people i&nbsp; miss, and all the people i love(d)&nbsp;


I love a new school year..

So i have been up and down.&nbsp; Well i dont know. I have been really crazy lately. Not in a crazy sense. but yeah...&nbsp;
first there is The Christopher situation. I dont know what is going on. Everytime i give up on him,&nbsp;something happends or i hear something that makes me rethink my thoughts, and makes me wonder if he actually does care for me or not.&nbsp; So, basically, i am between a rock and a hard spot. And it is not a very comfortable situation to be in. I guess it is just .. crazy.&nbsp;

So on myspace i always post the.. (i hate boys) or the (I love boys), pretty often. That is to show everyone the craziness of what i feel. Only a few people actually notice. But it is ok. I like doing it. It lets boys know when to back off for a bit, and when to come to me.&nbsp;

No more secret lovers.. I cannot stand it anymore. No&nbsp; more being used, and no more being abused.. emotionaly. I just cannot stand it.&nbsp; SO yeah. i am liking one guy right now, and sticking to it. (Even if he is the worst type to even play around with) I dont care.&nbsp;

its ok.

Gah! Camp.. what to say. It is insane! Everything is ok... with the whole designing the Yearbook.. and picking the theme and all that great jazz.. But when Mary Hartstern and I (2 out of the 3 editiors for next years log) find something totally awesome and different... it get shot down by Nick Sprague. (sp?) Yeah.. he is driving me nuts. Like today i had to redesign 5.. YES COUNT THEM 5!!! different Covers for the yearbook.. because he wasnt happey. So i just got done with one that everyone kind of wanted.. Now it is too plain for his standards. It is driving me insane. I dont know if mary and i will be able to handle this next year.&nbsp; Mrs. Green must have had something wonderful in mind for her to have 3 editiors for a much smaller yearbook. And to have one of them be the Greenest guy.. (if you are/were in pub, you should know what that means.) be paired up with a yellow/gold and a blue. Hello! Train wreck ready to happen.


I need to get out of this camp. I am currently 15 minutes into a 30 minute break. and i am spending it with the last shread of humanity i have left.&nbsp;


(oh J-camp, how i love thee)
